import React from 'react';
import styles from './Conditions.module.css';
import Button from '../../UI/Button';
const Conditions = (props) => {
    return (
        <li className={styles.city}>
            <div className={styles.Wrapper}>
                {/*props.error && <small className={styles.Small}>Please enter a valid city.</small>*/}
                {props.loading && <div className={styles.Loader} />}

                {!props.error && props.responseObj.cod === 200 ?
                    <div>
                        <h3 className={styles.h3}><strong>{props.responseObj.name}</strong></h3>
                        <p>It is currently {Math.round(props.responseObj.main.temp)} degrees out with {props.responseObj.weather[0].description}.</p>
                    </div>
                : null}
            </div>
            <div>
                <Button>Delete</Button>
            </div>
        </li>

    );
}

export default Conditions;
